import '../css/Addmodal.css';

function Addmodal() {
  return (

      <div id="modal" class="modal-overlay">
        <div class="modal-window">
          <div class="title">
            <h2>메뉴추가</h2>
          </div>
          <div class="content">
            <p>이름</p>
            <p>가격</p>
            <p>상품 이미지</p>
          </div>
        </div>
      </div>

  );
}

export default Addmodal;
